Artículo único.- Denomínase en la forma que a continuación se indica a los siguientes establecimientos educacionales:
a) "Rector Abdón Andrade Coloma" al Liceo de Hombres de La Unión;
b) "Enrique Graf Reyes" a la Escuela N° 64, de la localidad de Roblería, comuna de Coihueco, departamento de Chillán;
c) "Rómulo J. Peña Maturana", a la Escuela N° 9, de Antofagasta;
d) "Artemón Pérez", a la Escuela Rural N° 111, de Santa Cruz;
e) "Escuela Vicepresidente Edmundo Pérez Zujovic", a la Escuela N° 23, del departamento de Antofagasta, ubicada en la Estación Baquedano;
f) "Rosa Cerda Aguilera", a la Escuela N° 1, de Hombres, ubicada en la ciudad de Freirina, provincia de Atacama;
g) "Luis Uribe Díaz", a la Escuela N° 1, de Castro, y
h) "Escuela Inés Muñoz de García", a la Escuela N° 2 de Castro.
